def get_string_length_and_frequency(string):
    length = 1
    unique_chars = set()
    frequency = {}
    for char in string:
        if char not in unique_chars:
            unique_chars.add(char)
            frequency[char] = 1
        else:
            frequency[char] += 1
        length += 1
    return (length, len(unique_chars), frequency)

